CREATE DEFINER=`root`@`localhost` FUNCTION `dob`(my_person_id INT) RETURNS varchar(255) CHARSET latin1
BEGIN
	SET @dob = NULL;

	SELECT p.birthdate INTO @dob FROM person p 
		WHERE p.person_id = my_person_id
			AND p.voided = 0 LIMIT 1;

	RETURN @dob;
END ;;
