CREATE DEFINER=`root`@`localhost` FUNCTION `dob_estimated`(my_person_id INT) RETURNS varchar(255) CHARSET latin1
BEGIN
	SET @dob_e_flag = NULL;
	SET @dob_e_resp = NULL;

	SELECT p.birthdate_estimated INTO @dob_e_flag FROM person p 
		WHERE p.person_id = my_person_id
			AND p.voided = 0 LIMIT 1;

	IF @dob_e_flag = 1 THEN
		SET @dob_e_resp = 'YES';
	ELSE
		SET @dob_e_resp = 'NO';
	END IF;

	RETURN @dob_e_resp;
END ;;
