CREATE DEFINER=`root`@`localhost` PROCEDURE `update_regimens`(INOUT update_stat VARCHAR(100))
BEGIN
 
DECLARE v_finished, rp_patient_id INTEGER DEFAULT 0;
DECLARE rp_identifier, rp_regimen, rp_notes varchar(100) DEFAULT "";
DECLARE rp_encounter_date, v_date_created, v_encounter_datetime DATE DEFAULT NULL;
DECLARE v_encounter_id, v_creator, v_location_id INTEGER DEFAULT NULL;

-- declare cursor for backfill data
DEClARE update_cursor CURSOR FOR
	SELECT patient_identifier, encounter_date, regimen, notes, patient_id FROM regimens_patch WHERE regimen IS NOT NULL;
 
-- declare NOT FOUND handler
DECLARE CONTINUE HANDLER
	FOR NOT FOUND SET v_finished = 1;
 
OPEN update_cursor;

SET update_stat = "done";

DELETE FROM regimens_fail;
 
get_data: LOOP
	FETCH update_cursor INTO rp_identifier, rp_encounter_date, rp_regimen, rp_notes, rp_patient_id;
 
	IF v_finished = 1 THEN
	   LEAVE get_data;
	END IF;
    
    SET v_encounter_id = NULL, v_creator = NULL, v_encounter_datetime = NULL, v_date_created = NULL, v_location_id = NULL;
    SELECT encounter_id, creator, encounter_datetime, date_created, location_id 
        INTO v_encounter_id, v_creator, v_encounter_datetime, v_date_created, v_location_id 
        FROM encounter 
        WHERE encounter_type = 116 AND patient_id = rp_patient_id 
            AND DATE(encounter_datetime) = DATE(rp_encounter_date) AND voided = 0 LIMIT 1;

    IF v_encounter_id IS NULL THEN
        SET update_stat = "done";
        INSERT INTO regimens_fail (patient_identifier, encounter_date, regimen, notes, patient_id) VALUES(rp_identifier, rp_encounter_date, "NOT DONE", rp_notes, rp_patient_id);
        -- Update records
    ELSE
         -- SET update_stat = CONCAT(v_encounter_id, CONCAT(v_creator, CONCAT(v_encounter_datetime, v_date_created)));
        SET update_stat = CONCAT(CONCAT(v_encounter_id, " "), rp_patient_id);

        INSERT INTO obs (encounter_id, obs_datetime, person_id, concept_id, value_text, creator, date_created, voided, location_id, uuid) 
           VALUES(v_encounter_id, v_encounter_datetime, rp_patient_id, 6882, rp_regimen, v_creator, v_date_created, 0, v_location_id, (SELECT UUID()));

		SET @temp_obs = NULL;
		SELECT obs_id INTO @temp_obs FROM obs WHERE concept_id = 6882 AND person_id = rp_patient_id AND obs_datetime = rp_encounter_date LIMIT 1;

        INSERT INTO regimens_fail (patient_identifier, encounter_date, regimen, notes, patient_id) VALUES(rp_identifier, 
rp_encounter_date, CONCAT(CONCAT(rp_regimen, " "), @temp_obs), rp_notes, rp_patient_id);

    END IF;
	
	SET v_finished = 0;

END LOOP get_data;
 
CLOSE update_cursor;
 
END ;;
